// src/components/Navbar.js
function Navbar() {
  return (
    <nav style={styles.nav}>
      
      <ul style={{ listStyle: 'none', display: 'flex', justifyContent: 'flex-end', padding: 5, margin: 5 }}>
        <li style={{ marginLeft: '65rem' }}><a href="/" style={styles.link}>Home</a></li>
        <li style={{ marginLeft: '1rem' }}><a href="/about" style={styles.link}>About</a></li>
        <li style={{ marginLeft: '1rem' }}><a href="/services" style={styles.link}>Services</a></li>
        <li style={{ marginLeft: '1rem' }}><a href="/contact" style={styles.link}>Contact</a></li>
      </ul>
    </nav>
  );
}
export default Navbar;

const styles = {
  nav: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    //backgroundColor: '#333',
    color: 'white',
    padding: '1rem 2rem',
  },
  logo: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navLinks: {
    listStyle: 'none',
    display: 'flex',
    gap: '1.5rem',
    margin: 0,
  },
  link: {
    color: 'white',
    textDecoration: 'none',
    fontSize: '1rem',
  },
};
